DROP TABLE IF EXISTS `personas`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `personas` (
  `persona_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) NOT NULL,
  `apellidos` varchar(100) NOT NULL,
  `email` varchar(255) NOT NULL,
  `telefono` varchar(15) DEFAULT NULL,
  `celular` varchar(15) DEFAULT NULL,
  `direccion_id` int(10) unsigned NOT NULL,
  `fecha_inicial` date DEFAULT NULL,
  `fecha_final` date DEFAULT NULL,
  `entidad_id` int(10) unsigned NOT NULL,
  `personadetalle_id` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`persona_id`,`direccion_id`,`entidad_id`),
  KEY `FK_entidad_id_idx` (`entidad_id`),
  KEY `FK_direccion_id_idx` (`direccion_id`),
  CONSTRAINT `FK_direccion_id` FOREIGN KEY (`direccion_id`) REFERENCES `direcciones` (`direccion_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_entidad_id` FOREIGN KEY (`entidad_id`) REFERENCES `entidades` (`entidad_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=901 DEFAULT CHARSET=latin1;
