  `productodetalle_id` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`producto_id`),
  KEY `FK_proveedor_idx` (`proveedor_id`),
  KEY `FK_UnidadMedida_idx` (`unidadMedida_id`),
